import React, { useEffect, useState } from 'react';
import {
  getProperties,
  createProperty,
  createResident,
  configureGuestParkingRules,
} from '../utils/api';

function ManagerDashboard() {
  const [properties, setProperties] = useState([]);
  const [newProperty, setNewProperty] = useState({ name: '', address: '', parkingSpots: 0 });
  const [newResident, setNewResident] = useState({
    name: '',
    email: '',
    password: '',
    propertyId: '',
  });
  const [guestParkingRules, setGuestParkingRules] = useState({
    paymentType: 'free', // Options: 'free', 'paid'
    maxDuration: '', // e.g., '3 days per week'
    parkingZone: '', // e.g., 'Guest Lot A'
    vehicleLimit: '', // e.g., '1 permit per week'
  });

  useEffect(() => {
    const fetchProperties = async () => {
      try {
        const data = await getProperties();
        console.log('Fetched properties:', data); // Debugging line
        setProperties(data);
      } catch (error) {
        console.error('Error fetching properties:', error.response?.data?.message || 'An error occurred');
      }
    };
    fetchProperties();
  }, []);

  const handleCreateProperty = async (e) => {
    e.preventDefault();
    try {
      const createdProperty = await createProperty(newProperty);
      setProperties([...properties, createdProperty]);
      setNewProperty({ name: '', address: '', parkingSpots: 0 });
      alert('Property created successfully!');
    } catch (error) {
      console.error('Error creating property:', error.response?.data?.message || 'An error occurred');
      alert('Failed to create property: ' + (error.response?.data?.message || 'Please try again'));
    }
  };

  const handleCreateResident = async (e) => {
    e.preventDefault();
    try {
      console.log('Creating resident with data:', newResident); // Debugging line
      const createdResident = await createResident(newResident);
      alert('Resident created successfully!');
      setNewResident({ name: '', email: '', password: '', propertyId: '' });
    } catch (error) {
      console.error('Error creating resident:', error.response?.data?.message || 'An error occurred');
      alert('Failed to create resident: ' + (error.response?.data?.message || 'Please try again'));
    }
  };

  const handleConfigureGuestParkingRules = async (e) => {
    e.preventDefault();
    try {
      await configureGuestParkingRules(guestParkingRules);
      alert('Guest parking rules configured successfully!');
    } catch (error) {
      console.error('Error configuring guest parking rules:', error.response?.data?.message || 'An error occurred');
      alert('Failed to configure guest parking rules: ' + (error.response?.data?.message || 'Please try again'));
    }
  };

  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-6">Property Manager Dashboard</h1>

      {/* Create Property Form */}
      <div className="mb-6">
        <h2 className="text-xl font-semibold mb-4">Create New Property</h2>
        <form onSubmit={handleCreateProperty} className="space-y-4">
          <input
            type="text"
            name="name"
            placeholder="Property Name"
            value={newProperty.name}
            onChange={(e) => setNewProperty({ ...newProperty, name: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <input
            type="text"
            name="address"
            placeholder="Property Address"
            value={newProperty.address}
            onChange={(e) => setNewProperty({ ...newProperty, address: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <input
            type="number"
            name="parkingSpots"
            placeholder="Number of Parking Spots"
            value={newProperty.parkingSpots}
            onChange={(e) => setNewProperty({ ...newProperty, parkingSpots: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <button type="submit" className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
            Create Property
          </button>
        </form>
      </div>

      {/* Create Resident Form */}
      <div className="mb-6">
        <h2 className="text-xl font-semibold mb-4">Create New Resident</h2>
        <form onSubmit={handleCreateResident} className="space-y-4">
          <input
            type="text"
            name="name"
            placeholder="Resident Name"
            value={newResident.name}
            onChange={(e) => setNewResident({ ...newResident, name: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <input
            type="email"
            name="email"
            placeholder="Resident Email"
            value={newResident.email}
            onChange={(e) => setNewResident({ ...newResident, email: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <input
            type="password"
            name="password"
            placeholder="Resident Password"
            value={newResident.password}
            onChange={(e) => setNewResident({ ...newResident, password: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <select
            value={newResident.propertyId}
            onChange={(e) => {
              const selectedPropertyId = e.target.value;
              console.log('Selected propertyId:', selectedPropertyId); // Debugging line
              setNewResident({ ...newResident, propertyId: selectedPropertyId });
            }}
            className="w-full p-2 border rounded"
            required
          >
            <option value="">Select a property</option>
            {properties.map((property) => (
              <option key={property._id} value={property._id}>
                {property.name}
              </option>
            ))}
          </select>
          <button type="submit" className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600">
            Create Resident
          </button>
        </form>
      </div>

      {/* Configure Guest Parking Rules */}
      <div className="mb-6">
        <h2 className="text-xl font-semibold mb-4">Configure Guest Parking Rules</h2>
        <form onSubmit={handleConfigureGuestParkingRules} className="space-y-4">
          <select
            value={guestParkingRules.paymentType}
            onChange={(e) => setGuestParkingRules({ ...guestParkingRules, paymentType: e.target.value })}
            className="w-full p-2 border rounded"
            required
          >
            <option value="free">Free Parking</option>
            <option value="paid">Paid Parking</option>
          </select>
          <input
            type="text"
            name="maxDuration"
            placeholder="Maximum Duration (e.g., 3 days per week)"
            value={guestParkingRules.maxDuration}
            onChange={(e) => setGuestParkingRules({ ...guestParkingRules, maxDuration: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <input
            type="text"
            name="parkingZone"
            placeholder="Parking Zone (e.g., Guest Lot A)"
            value={guestParkingRules.parkingZone}
            onChange={(e) => setGuestParkingRules({ ...guestParkingRules, parkingZone: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <input
            type="text"
            name="vehicleLimit"
            placeholder="Vehicle Limit (e.g., 1 permit per week)"
            value={guestParkingRules.vehicleLimit}
            onChange={(e) => setGuestParkingRules({ ...guestParkingRules, vehicleLimit: e.target.value })}
            className="w-full p-2 border rounded"
            required
          />
          <button type="submit" className="bg-purple-500 text-white px-4 py-2 rounded hover:bg-purple-600">
            Save Guest Parking Rules
          </button>
        </form>
      </div>
    </div>
  );
}

export default ManagerDashboard;
